const Home = () => {
  const handleClick = (e) => {
    console.log("hello, hackers", e);
  };

  const handleClickAgain = (name, e) => {
    console.log("hello " + name, e.target);
  };

  return (
    <div className="home">
      <h2>Homepage</h2>
      <button onClick={handleClick}>Click me</button>
      <button onClick={() => handleClickAgain("mario")}>Click again</button>
    </div>
  );
};

export default Home;
